About:
Registry First Aid will help you find and correct problems with your system registry. Registry First Aid scans registry for orphan file/folder references, finds these files or folders on your drives that may have been moved from their initial locations, and then corrects your registry entries to match the located files or folders. In addition, if your registry has links to files of deleted applications, Registry First Aid will find these invalid entries and remove them from your registry. With Registry First Aid, your Windows registry will be always clean and correct, helping your programs load faster and speeding up your computer.

Features:

   Find invalid file/folder references in Windows registry;
   Select drives and paths where to search registry referenced files/folders;
   Select found matches to make corrections to invalid registry entries;
   Delete incorrect registry references to previously un-installed files or folders;
   Create undo files in RegEdit4 format, so you always can restore Windows registry to the original state.

